import React from 'react';
import '../../styles/experiencecard.scss';

const ExperienceCard = ({} : { title, company, location, link, duration, description, skills : []}) => {
  return (
    <div className="experience-card">
      <div className="experience-header">
        <h2>{title} @ {company}</h2>
        <p className="duration">{duration}</p>
      </div>
      <div className="experience-body">
        <p className="location"><i className="fas fa-map-marker-alt"></i> {location}</p>
        <a href={link} className="company-link" target="_blank" rel="noopener noreferrer">{link}</a>
        <p className="description">{description}</p>
        <div className="skills">
          {skills.map(skill => (
            <span key={skill} className="skill-tag">{skill}</span>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ExperienceCard;
